import Grid from '@mui/material/Grid';
import EmployeeCard from '../Components/EmployeeCard';
import EmployeeList from '../Components/EmployeeList';

function Home() {
    const buildCards = () => {
        var result
        for (let i=0;i<4;i++) {
            result += <Grid item xs={6}>
                <EmployeeCard cardnumber={i.toString()}/>
            </Grid>
        }
        return result
    }
	return (
		<div className="Home">
			<Box sx={{ flexGrow: 1 }}>
